    def imu_callback(self,msg):
        self.imu_a_x= msg.linear_acceleration.x
        self.imu_a_y=msg.linear_acceleration.y
        self.imu_a_z=msg.linear_acceleration.z
        self.imu_w_x=msg.angular_velocity.x
        self.imu_w_y=msg.angular_velocity.y
        self.imu_w_z=msg.angular_velocity.z
        self.x_imu_linear_label.setText(str(self.imu_a_x))
        self.y_imu_linear_label.setText(str(self.imu_a_y))
        self.z_imu_linear_label.setText(str(self.imu_a_z))
        self.x_imu_angular_label.setText(str(self.imu_w_x))
        self.y_imu_angular_label_2.setText(str(self.imu_w_y))
        self.z_imu_angular_label_3.setText(str(self.imu_w_z))

    def current_location(self,msg):
        
        self.gps_lat=msg.latitude
        self.gps_lon=msg.longitude
        self.lat_label.setText(str(self.gps_lat))
        self.long_label.setText(str(self.gps_lon))

    def location_in_x_y(self,msg):
        self.location_x=msg.x
        self.location_y=msg.z
        self.x_location_label.setText(str(self.location_x))
        self.Y_loacation_label.setText(str(self.location_y))   

    def cmd_vel_msg_print_callback(self,msg):
        self.linear_velocity_cmd_vel=msg.linear.x
        self.angular_velocity_cmd_vel=msg.angular.z
        self.cmd_vel_x_label.setText(str(self.linear_velocity_cmd_vel))
        self.cmd_vel_angular_label.setText(str(self.angular_velocity_cmd_vel))
        
    def __init__(self):
        self.cmd_vel_sub=rospy.Subscriber('/cmd_vel',Twist, self.cmd_vel_msg_print_callback)
        self.imu_sub=rospy.Subscriber("/imu/data",Imu,self.imu_callback)
        self.gps_sub=rospy.Subscriber('/gps_fix',NavSatFix,self.current_location)
        self.location_x_y=rospy.Subscriber('/location_in_x_y',g2g_x_z,self.location_in_x_y)
        

    def publish(self,l_x,a_z):
        cmd="rostopic pub /cmd_vel geometry_msgs/Twist '{linear:  {x: %f , y: 0.0 , z: 0.0}, angular:{x: 0.0,y: 0.0, z: %f}}'" %(l_x,a_z)
        Popen(cmd,shell=True,stdout=PIPE,stderr=PIPE)
        print("--> publishing")
    
    def forward(self):
        #global l_x,a_z
        self.a_z=0
        if self.l_x==0:
            self.l_x=0.7
        else:
            self.l_x=self.l_x + 0.02
        self.publish(self.l_x,self.a_z)
        print("--> moving forward")
    
    def backward(self):
        #global l_x,a_z
        self.a_z=0.0
        if self.l_x==0:
            self.l_x=-0.7
        else:
            self.l_x=self.l_x - 0.02
        self.publish(self.l_x,self.a_z)
        print("--> moving backward")
    
    def right_turn(self):
        #global l_x,a_z
        self.l_x=0
        if self.a_z==0:
            self.a_z=-0.3
        else:
            self.a_z=self.a_z-0.02
        self.publish(self.l_x,self.a_z)
        print("--> right turn")

    def left_turn(self):
        #global l_x,a_z
        self.l_x=0
        if self.a_z==0:
            self.a_z=0.3
        else:
            self.a_z=self.a_z+0.02
        self.publish(self.l_x,self.a_z)
        print("--> left turn")

    def stop(self):
        global l_x,a_z
        self.l_x=0
        self.a_z=0
        self.publish(self.l_x,self.a_z)
        print("--> stop")


